def weightfunc(numcorrect, numwrong):
    if numcorrect <= 3:
        return 1
    else:
        pct_correct = numcorrect / (numcorrect + numwrong)
        if pct_correct < 0.75:
            return 1
        else:
            return -0.9/0.25 * pct_correct + 0.1 + 0.9/0.25

def is_mastered(word, correct, incorrect):
  return (correct[word] > 3 and
          correct[word] / (correct[word] + incorrect[word]) >= 0.75)

if __name__ == '__main__':
  try:
    with open('flashcardrecord.csv', 'r') as f:
      correct = Counter()
      incorrect = Counter()
      reader = csv.DictReader(f)
      for row in reader:
        correct[row['word']] = int(row['correct'])
        incorrect[row['word']] = int(row['incorrect'])
  except FileNotFoundError:
      correct = Counter()
      incorrect = Counter()

  try:
    wordlist = list(WORDDICT.keys())
    random.shuffle(wordlist)
    available_words = wordlist[:20]
    num_mastered_words = 0
    print("available_words %s" %(str(available_words)))
    while True:
      if sum([int(is_mastered(word, correct, incorrect)) for word in available_words]) > num_mastered_words:
        print("New word unlocked!")
      num_mastered_words = sum([int(is_mastered(word, correct, incorrect)) for word in available_words])
      available_words = wordlist[:(20 + num_mastered_words)]
      word = random.choice(available_words)
      # Downsample words that have been answered correctly many times already.
      wt = weightfunc(correct[word], incorrect[word])
      if random.random() > wt:
        continue

      gender = WORDDICT[word]
      guess = input("%s: Masculin ou féminin? (m/f)" % word)
      if guess == gender:
        print("CORRECT!\n")
        correct[word] += 1
      else:
        print("INCORRECT!\n")
        incorrect[word] += 1
  except KeyboardInterrupt:
    print("Correct:")
    print(correct)
    print("Incorrect:")
    print(incorrect)

    wordsseen = list(set(correct.keys()).union(set(incorrect.keys())))
    with open('flashcardrecord.csv', 'w') as f:
      fieldnames = ['word', 'correct', 'incorrect']
      writer = csv.DictWriter(f, fieldnames=fieldnames)

      writer.writeheader()
      for word in wordsseen:
        writer.writerow({
          'word': word,
          'correct': correct[word],
          'incorrect': incorrect[word]
        })
